import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';

const Packages = () => {
    const [packages, setPackages] = useState([]);
    useEffect(() => {
        fetch('toursim.json')
            .then(res => res.json())
            .then(data => setPackages(data))
    }, [])
    return (
        <div className="row">
            <h2>{packages.length}</h2>
        </div>
    );
};

export default Packages;
